// SPDX-License-Identifier: MIT


pragma solidity >=0.4.0 <=0.9.0;

import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
//SWC-107
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
//SWC-103
contract PragmaFixed {
    uint public x = 1;
}
contract Token is Context, IERC20Metadata {
    using SafeMath for uint256;
    //address and its balances of token.
    mapping(address => uint256) private _balances;
    //amount one address can spend from other address account,
    mapping(address => mapping(address => uint256)) private _allowances;
    //total supply of tokens in the contract.
    uint256 private _totalSupply;
    string private constant _name= "music_Token";
    string private constant _symbol="mus";
    uint8 private constant _decimals = 18;
    //max token
    uint256 public constant max_token = 100000 * (10**_decimals); 

    constructor(
        //add of owner
        address _to
    ) {
        //check if add not zero
        require(_to != address(0), "error: add is zero");
        _mint(_to, max_token);
    }
    //
